using OebbGoogle.SpeechToText.Models;
using System;

namespace OebbGoogle.SpeechToText.Console
{
    public class Program
    {
        static void Main(string[] args)
        {
            const string apiKey = ""; // Your own API Key here.

            var client = new RecognizeClient("https://speech.googleapis.com/v1/speech:recognize", apiKey, "x-Gateway-APIKey", "34d221ac-5e31-41fa-9a30-648a53f9a4c8");
            var response = client.RecognizeAsync(new Models.RecognizeRequest
            {
                Config = new Models.RecognitionConfig
                {
                    AudioChannelCount = 1,
                    EnableAutomaticPunctuation = true,
                    EnableSeparateRecognitionPerChannel = false,
                    EnableWordTimeOffsets = false,
                    LanguageCode = "de-DE",
                    MaxAlternatives = 3,
                    Model = RecognitionModels.Default,
                    ProfanityFilter = false,
                    SampleRateHertz = 48000,
                    UseEnhanced = true
                },

                Audio = new Models.RecognitionAudio
                {
                    Content = TestAudio
                }
            });

            System.Console.WriteLine(System.Text.Json.JsonSerializer.Serialize(response));
        }

        public const string TestAudio = "";
    }
}
